        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "Nos termos da lei vietnamita, as informações dos usuários, como nomes, endereços de email, senhas e data de nascimento, podem ser classificadas como \"informações pessoais.\n\n Em particular,\n (a) Nos termos do Decreto 72/2013, informações pessoais são definidas como informações anexadas à identificação da identidade e detalhes pessoais de um indivíduo, incluindo nome, idade, endereço, número do cartão de identidade das pessoas, número de telefone, endereço de e-mail e outras informações conforme estipulado por lei\n\n (b) Nos termos da Circular 25/2010, informações pessoais significam informações suficientes para identificar com precisão um indivíduo, incluindo pelo menos um dos seguintes detalhes: nome completo, data de nascimento, ocupação, cargo, endereço de contato, endereço de email, número de telefone, identidade número do cartão e número do passaporte. As informações de privacidade pessoal incluem registro de saúde, registro de pagamento de impostos, número do cartão de seguro social, número do cartão de crédito e outros segredos pessoais.\n\n A Circular 25 se aplica à coleta e uso de informações pessoais por sites operados por autoridades governamentais vietnamitas. A Circular 25 não se aplica diretamente à coleta e uso de informações pessoais por sites operados por entidades não governamentais. No entanto, as disposições da Circular 25 poderiam ser aplicadas por analogia. Além disso, é provável que uma entidade não governamental esteja sujeita aos mesmos ou mais padrões rigorosos que os aplicáveis a uma entidade governamental."),
